import '../styles/App.css';
import SearchBar from './Javascript/SearchBar';

function App() {
  return (
    <div>
      <SearchBar />
      <div className="App">
        <header className="App-header">
          <h1>Spotify Jamming</h1>
          <div>
            <p>This website is still under development</p>
          </div>
        </header>
      </div>
    </div>
  );
}

export default App;
